import React, {Component} from 'react';   
class Match extends Component {

    constructor(props){
        super(props)
        this.state = { 
            match:'',
        }
     }
    
    render() { 
        const { match } = this.props;
                if (!match.data)
                    return <div>Empty</div>;

        let tagText = '';

        match.data.map((item, i) => {
            if (item.type === 'matches') {
                tagText = "Matches : ";
                console.log("Matches : ",item)
                //return (item.type);
            }

            if (match.type === 'videos') {
                console.log( "video : ",item)
                tagText = "video : ";
                return <div>Videos</div>
                // tagText= "this is Videos Object";
            }

            if (match.type === 'news') {
                console.log("News : ", item);
                tagText = "News : ";
                //return <div>news</div>
            }

            if (match.type === 'articles') {
                console.log("Articles : ", item);
                tagText = "Articles : ";
                //return <div>Articles </div>
            }
        });

        return tagText;

    }
}

export default Match;
